import React, { Component } from "react";
import { Navigate } from "react-router";
import axios from "axios";

class AgregarProducto extends Component {
    codigo = React.createRef();
    producto = React.createRef();
    nit = React.createRef();
    precioCompra = React.createRef();
    iva = React.createRef();
    precioVenta = React.createRef();
    render() {
        return (
            <div>
                <h1>Agregar Producto</h1>
                <br></br>
                <form>
                    <div>
                        <label>Codigo del Producto</label>
                        <input type="text" name="codigo"></input>
                    </div>
                    <div>
                        <label>Producto</label>
                        <input type="text" name="producto"></input>
                    </div>
                    <div>
                        <label>Nit del Producto</label>
                        <input type="text" name="nit"></input>
                    </div>
                    <div>
                        <label>Precio Compra del Producto</label>
                        <input type="text" name="precioCompra"></input>
                    </div>
                    <div>
                        <label>Iva del Producto</label>
                        <input type="text" name="iva"></input>
                    </div>
                    <div>
                        <label>Precio Venta del Producto</label>
                        <input type="text" name="precioVenta"></input>
                    </div>
                    <div class="form-goup p-2 center">
                        <button type="submit" class="btn btn-primary btn-block">
                            Cargar
                        </button>
                    </div>
                </form>
            </div>
        );
    }
}

export default AgregarProducto;
